export class InfectionMeningite {
    IdInfectionMeningite: number;
    PatientId: number;
    Meningite: boolean;
    Nombre: number;
    Date: string;
    LieuHospitalisation: string;
    SiegesMeninges?: boolean;
    Cephalees?: boolean;
    Fievre?: boolean;
    SignesNeurologique?: boolean;
    Autre?: boolean;
    PreciserAutre?: string;
    PonctionLombaire: string;
    GermeIsole: boolean;
    TypeGermeIsole?: string;
    Siege?: string;
    HyperhydratationPerso?: boolean;
    HyperhydratationIv?: boolean;
    AntalgiquesPalliesI?: boolean;
    AntalgiquePallierIi?: boolean;
    AntalgiquePallierIii?: boolean;
    TransfusionSimple?: boolean;
    EchangeTransfusionnel?: boolean;
    TypeAntibiotherapie: string;
    Duree: number;
    Sequelles?: boolean;
    PreciserSequelles?: string;

    constructor() {
        this.IdInfectionMeningite = 0;
        this.PatientId = 0;
        this.Meningite = false;
        this.Nombre = 0;
        this.Date = '';
        this.LieuHospitalisation = '';
        this.SiegesMeninges = false;
        this.Cephalees = false;
        this.Fievre = false;
        this.SignesNeurologique = false;
        this.Autre = false;
        this.PreciserAutre = '';
        this.PonctionLombaire = '';
        this.GermeIsole = false;
        this.TypeGermeIsole = '';
        this.Siege = '';
        this.HyperhydratationPerso = false;
        this.HyperhydratationIv = false;
        this.AntalgiquesPalliesI = false;
        this.AntalgiquePallierIi = false;
        this.AntalgiquePallierIii = false;
        this.TransfusionSimple = false;
        this.EchangeTransfusionnel = false;
        this.TypeAntibiotherapie = '';
        this.Duree = 0;
        this.Sequelles = false;
        this.PreciserSequelles = '';
    }
}
